import React, { Component } from 'react';
import UserAdd from './components/UserAdd';
import Users from './components/Users';
import './App.css';

export default class App extends Component {




  render() {
    const  kategori  = { title: "Kategori", title1: "product" }

    return (
      <div className="container">
        <h1 className='text-center'>My-Apps</h1>
        <div className=' d-flex justify-content-space-between align-item-center'>

          <Users kategori={kategori.title1} />
          <UserAdd kategori={kategori.title} /></div> 
      </div>
    );
  }
}
